    {
      "cell_type": "code",
      "metadata": {
        "id": "SWaI9morFxJ2",
        "colab_type": "code",
        "colab": {}
      },
      "source": [
        "#model_1\n",
        "loss_list=[]\n",
        "sess.run(init)\n",
        "for i in range(0,10000):\n",
        "  fd ={x:X, y:Y}\n",
        "  _, loss_val = sess.run([Optimizer, Loss], feed_dict=fd)\n",
        "  #print ('loss = %s' % loss_val)\n",
        "  loss_list.append(loss_val)\n",
        "\n",
        "YP1 = sess.run(output_layer,feed_dict={x:X})"
      ],
      "execution_count": 0,
      "outputs": []
    },
