    {
      "cell_type": "code",
      "metadata": {
        "id": "TO59atoUlXRP",
        "colab_type": "code",
        "colab": {}
      },
      "source": [
        "X =np.expand_dims(np.arange(0.0, 3.0, 0.01),1)\n",
        "Y =np.sin(3*X)\n",
        "\n",
        "x = tf.placeholder(tf.float64, [300,1], name='x')\n",
        "y = tf.placeholder(tf.float64, [300,1], name='y')"
      ],
      "execution_count": 0,
      "outputs": []
    },
    {
      "cell_type": "code",
      "metadata": {
        "id": "BlTaGAO2igP3",
        "colab_type": "code",
        "colab": {}
      },
      "source": [
        "# Model_2\n",
        "\n",
        "input_layer = tf.layers.dense(x, 1)\n",
        "hidden_layer1 = tf.layers.dropout(input_layer,0.2)\n",
        "hidden_layer2 = tf.layers.dense(hidden_layer1,10,activation=tf.nn.relu)\n",
        "hidden_layer3 = tf.layers.dense(hidden_layer2,11,activation=tf.nn.relu)\n",
        "hidden_layer4 = tf.layers.dense(hidden_layer3,10,activation=tf.nn.relu)\n",
        "output_layer = tf.layers.dense(hidden_layer4,1)\n",
        "\n",
        "Loss =tf.losses.mean_squared_error(y , output_layer)\n",
        "Optimizer = tf.train.AdamOptimizer(learning_rate= 0.001).minimize(Loss)\n",
        "init = tf.global_variables_initializer()"
      ],
      "execution_count": 0,
      "outputs": []
    },
    {
      "cell_type": "code",
      "metadata": {
        "id": "Nsb3-aUPhSAC",
        "colab_type": "code",
        "colab": {}
      },
      "source": [
        "#model_2\n",
        "loss_list_2=[]\n",
        "sess.run(init)\n",
        "for i in range(0,10000):\n",
        "  fd ={x:X, y:Y}\n",
        "  _, loss_val = sess.run([Optimizer, Loss], feed_dict=fd)\n",
        "  #print ('loss = %s' % loss_val)\n",
        "  loss_list_2.append(loss_val)\n",
        "\n",
        "YP2 = sess.run(output_layer,feed_dict={x:X})"
      ],
      "execution_count": 0,
      "outputs": []
    },
